import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";

// Import Components
import Home from "./Home";
import About from "./About";
import Contact from "./Contact";
import TFI from "./TFI";

const App = () => {
  return (
    <Router>
      <div>
        {/* Header Section */}
        <header style={{ display: "flex", alignItems: "center", padding: "10px" }}>
          <h1 style={{ flex: 1 }}>NSS Vasavi College of Engineering</h1>
          <img
            src="https://via.placeholder.com/100"
            alt="Logo"
            style={{ height: "50px" }}
          />
        </header>

        {/* Navigation Bar */}
        <nav style={{ backgroundColor: "#333", padding: "10px", position: "sticky", top: 0, zIndex: 1000 }}>
          <ul
            style={{
              display: "flex",
              listStyleType: "none",
              margin: 0,
              padding: 0,
              justifyContent: "space-around",
            }}
          >
            <li>
              <Link
                to="/"
                style={{ color: "white", textDecoration: "none", fontSize: "18px" }}
              >
                Home
              </Link>
            </li>
            <li>
              <Link
                to="/about"
                style={{ color: "white", textDecoration: "none", fontSize: "18px" }}
              >
                About
              </Link>
            </li>
            <li>
              <Link
                to="/contact"
                style={{ color: "white", textDecoration: "none", fontSize: "18px" }}
              >
                Contact
              </Link>
            </li>
            <li>
              <Link
                to="/tfi"
                style={{ color: "white", textDecoration: "none", fontSize: "18px" }}
              >
                TFI
              </Link>
            </li>
          </ul>
        </nav>

        {/* Routes */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/tfi" element={<TFI />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
